import React, { Component } from 'react';
import jam from '../jam.png';

class Main extends Component {
    render() {
        return (
            <div id="content" className='mt-3'>
                <table className="table table-borderless text-muted text-centers">

                    <thead>
                        <tr>
                            <th scope="col"> Balance Stakings</th>
                             <th scope="col"> Staking profit</th>
                        </tr>
                    </thead>
                </table>
            </div>

        )
    }
}
